import React, { Component } from "react";
import Button from "@material-ui/core/Button";

import { connect } from "react-redux";

// import { increment } from "./redux/action";
import { loginAction } from "./redux/action/loginAction";
import "./css/login.css";

const mapStateToProps = state => {
  return {
    counter: state.counter,
    isLogin: state.isLogin
  };
};

const mapDispatchToProps = dispatch => {
  return {
    //increment: addCount => dispatch(increment(addCount)),
    loginAction: email => dispatch(loginAction(email))
  };
};

export class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "",
      password: ""
    };
    // this.handleChange = this.handleChange.bind(this);
  }

  increment = addCount => {
    this.props.increment(5);
  };

  handleChange = event => {
    this.setState({
      [event.target.id]: event.target.value
    });
  };

  handleSubmit = event => {
    event.preventDefault();
    const { email } = this.state;
    const password = this.state.password;
    this.props.loginAction({ email });
    this.setState({ email: "", password: "" });
  };

  render() {
    return (
      <div className="section">
        <h2>
          {this.state.email} {this.state.password}
        </h2>
        <Button onClick={this.increment}>+</Button>
        <h2>Login Page {this.props.counter}</h2>
        <h2>is Login {this.props.isLogin}</h2>
        <form onSubmit={this.handleSubmit}>
          <input
            type="text"
            name="email"
            id="email"
            placeholder="email"
            onChange={this.handleChange}
          />
          <input
            type="password"
            name="password"
            id="password"
            placeholder="password"
            onChange={this.handleChange}
          />
          <Button color="secondary" variant="contained" type="submit">
            Submit
          </Button>
        </form>
      </div>
    );
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(Login);
